static char out[64];
static char* rows[8];

void run(struct Test* test)
{
    struct jpeg_decompress_struct de;
    jpeg_component_info ci;

    de.sample_range_limit = test->r - test->general.center;
    ci.dct_table = test->q;

#ifdef DISABLE_SIMD
    jpeg_idct_islow(&de, &ci, test->in, rows, 0);
#else
    jsimd_idct_islow(&de, &ci, test->in, rows, 0);
#endif

    if (memcmp(out, test->out, sizeof out) != 0) {
#ifdef DUMP_ASSERT		
        int ctr;
  fprintf(stderr, "\t/*out:*/ {%02x", out[0] & 0xff);
  for (ctr=1; ctr < DCTSIZE2;ctr++)fprintf(stderr, ",%02x", out[ctr] & 0xff);
  fprintf(stderr, "},\n");

  fprintf(stderr, "\t/*exp:*/ {%02x", test->out[0]);
  for (ctr=1; ctr < DCTSIZE2;ctr++)fprintf(stderr, ",%02x", test->out[ctr]);
  fprintf(stderr, "},\n");
#endif
        __builtin_trap();  
    }
}

#define TEST_ITER 10000

void _initialize()
{
    int i;
    for (i=0;i<8;i++) rows[i] = &out[i * 8];
}

void test() __attribute__((export_name("test")))
{
	int i, j;
	for (j=0; j < TEST_ITER; j++) {
		for (i=0; i < sizeof TESTS / sizeof(struct Test); i++) {
			run(&TESTS[i]);
		}
	}
}

void test500() __attribute__((export_name("test500")))
{
	int i;
	for(i=0; i<500; i++) test();
}
